import React from 'react';

/** 
 * TODO replace with api data
*/

export const navContent = [[
    {
        title: 'Home',
        icon: 'home'
    },
    {
        title: 'Recent',
        icon: 'history'
    },
    {
        title: 'Trending',
        icon: 'arrow_upward'
    },
    {
        title: 'Playlist',
        icon: 'queue'
    },
    {
        title: 'Favourites',
        icon: 'favorites'
    },],
    [
        {
            title: '3D Modelling',
            icon: 'home'
        },
        {
            title: 'Speechy',
            icon: 'history'
        },
        {
            title: 'Placeholder',
            icon: 'arrow_upward'
        },
        {
            title: 'Placeholder',
            icon: 'queue'
        },

    ]
];
